description:
Cast: Brooklyn Chase, Karmen Karma, Abella Danger, Ryan McLane, Tyler Nixon, Steven St. Croix, Tommy Gunn

Dream Zone Entertainment presents this XXX parody of the 1991 thriller &quot;Sleeping with the Enemy&quot;. A young woman (Bella Danger) fakes her own death in an attempt to escape her nightmarish marriage, but discovers it is impossible to elude her controlling husband (Steven St. Croix). Directed by Barrett Blade, the movie also stars Karmen Karma, Brooklyn Chase, Tyler Nixon, Tommy Gunn, and Ryan McLane.

Runtime: 1 hrs. 44 mins.

